script: |
  super -f text -I q9185.spq | sort > q9185.out

inputs:
  - name: q9185.spq
    data: |
      SELECT CAST ( + col0 AS REAL ) col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NULL BETWEEN - 81 / - + col1 * + 17 * + - col1 AND ( - - col1 / + + col0 );
  - name: tab2

outputs:
  - name: q9185.out
    data: |
